    	stxa    %l6, [%g0 + ASI_SPU_CWQ_TAIL] %asi
    	ldxa    [%g0 + ASI_SPU_CWQ_TAIL] %asi, %l1
    	cmp 	%l1, %l2
    	bne,pn 	%xcc,    _t1_fail
    	nop

